const Toolbar: React.FC<Props> = ({ onTabChange }) => {
  const [activeTab, setActiveTab] = useState(-1);
  return (
    <div className="toolbar-container w-full flex flex-row justify-between">
      {
        ButtonConfigs.map(({ icon, iconActive, label, tabId, onClick }, index) => (
          <Fragment key={index}>
            <button
              key={tabId}
              type="button"
              className={`toolbar__button w-1/6`}
              onClick={() => {
                onTabChange(tabId);
                setActiveTab(tabId)
              }}
            >
              <div className="flex flex-col items-center justify-center">
                <div className="w-[25px] h-[25px]">
                  {tabId === activeTab ? iconActive : icon}

                </div>
              </div>
              <span className={`text-sm uppercase  ${tabId === activeTab ? 'text-primary underline decoration-2' : 'text-secondary'}`}>{label}</span>
            </button>

            {/* add vertical divider for first tab */}
            {index === 0 && 
              <div className="ml-2 w-[1px] min-h-[1em]"
                style={{
                  backgroundImage: "linear-gradient(0deg, rgba(2,0,36,0) 0%, rgba(136,136,136,1) 30%, rgba(136,136,136,1) 70%, rgba(0,212,255,0) 100%)",
                }}
              />
            }
          </Fragment>

        ))
      }
    </div>
  );
};

export default Toolbar;
